import React, { useEffect } from 'react'
import axios from 'axios'
function Carrer() {
    const getting=async()=>{
      await fetch('https://jsonplaceholder.typicode.com/posts')
      .then((res)=>{
        console.log(res)
      })
    }


    useEffect(()=>{
        getting()
    },[])
    return (
        <>
        <div className="apicollection">
            <div className="container">
                
            </div>
        </div>
    
        </>
    )
}

export default Carrer
